Defendant in custody.
GUILTY plea entered to count 1, forgery.  Convicted.
The State moves to dismiss and read in counts 2 through 5.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for thirty-six (36) months.
Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) Maintain absolute sobriety;
3) Submit to random urine screens and pay for same;
4) No association with any known illicit drug users or distributors;
5) Maintain fulltime employment, schooling or combination;
6) Provide DNA sample.  (No DNA surcharges imposed);
7) Pay court costs;
8) pay supervision fees in an amount to be determined by DOC.
Minutes.
